package com.example.smallwhite.designpatterns.visitor.user.impl;import com.example.smallwhite.designpatterns.visitor.user.User;import com.example.smallwhite.designpatterns.visitor.visitor.Visitor;/** * @author: yangqiang * @create: 2021-03-02 20:48 */public class Student extends User {    public Student(String name, String identity, String clazz) {        super(name, identity, clazz);    }    @Override    public void accept(Visitor visitor) {        visitor.visit(this);    }    public int ranking() {        return (int) (Math.random() * 100);    }}